import React from 'react'
import img from '../../static/company.png'
import { Link } from 'react-router-dom'

function CardPostDetail() {
  return (
    <>
    <div className='card1 gray-bk centered-card'>
        <div className='card1-comp' >
        <img src={img} className='company-img' />
        <div>
        <span className='bold'>
            Internship Front End Developer
       </span>
       <div>
         <span>Coders</span>
         <span className='remote-btn-std'>Remote</span>
         <p>We are offering a training opportunity for (3) students on react and react native<br/>
         About training <br/>
         you are going to learn react and react nativeand how to code it using functions and hooks and you will take pre course for designing<br/> 
         Qualifications:<br/>
         -know html and css<br/>
         -know js 
         </p>
       </div>
       <div className='std-btns'>
       <Link to='/stdPost' >
            <button className='button-size-std navy-bk white-font'>
               Apply
             </button>
       </Link>
       </div>
        </div>
        </div>
    </div>
    </>
  )
}

export default CardPostDetail


